import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Url
import { getAllAssistants } from '../../../settings';

// Styles
import { MyBody, MyButton, UserTable } from './Assistant.styles';

const AssistantEndpoint = () => {
  const [assistants, setassistants] = useState([{}]);

  const fetchAssistants = async (getAllAssistants) => {
    const response = await fetch(getAllAssistants, {
      method: 'GET',
      headers: {
        'x-access-token':
        sessionStorage.getItem('jwtToken'),
        'Content-Type': 'application/json',
      },
    });
    const myAssistants = await response.json();

    setassistants(
      myAssistants.map((assistants) => {
        return assistants;
      })
    );
  };
  useEffect(() => {
    fetchAssistants(getAllAssistants);
  }, []);

  return (
    <MyBody>
      <UserTable>
      <thead>
          <tr>
            <th>Name</th>
            <th>Language</th>
            <th>Years of experience</th>
            <th>Price per hour</th>
          </tr>
        </thead>
        <tbody>
          {assistants.map((assistants) => (
            <tr key={assistants.name}>
              <td>{assistants.name}</td>
              <td>{assistants.language}</td>
              <td>{assistants.yearsOfExp}</td>
              <td>{assistants.priceHour}</td>
            </tr>
          ))}
        </tbody>
      </UserTable>
    </MyBody>
  );
};

export default AssistantEndpoint;
